;ul&gt;\n          &lt;li&gt; Address: tcp://10.7.0.129:8786 &lt;/li&gt;\n          &lt;li&gt; Workers: 120 &lt;/li&gt;\n          &lt;li&gt; Threads: 4800 &lt;/li&gt;\n          &lt;li&gt; Memory: 18.75 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+untagged.1.g608b984.dirty &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\n###################################################################################################\n# Copyright (c) 2020-2022 Centre national de la recherche scientifique (CNRS)\n# Copyright (c) 2020-2022 Commissariat a l'\u00e9nergie atomique et aux \u00e9nergies alternatives (CEA)\n# Copyright (c) 2020-2022 Institut national de recherche en informatique et en automatique (Inria)\n# Copyright (c) 2020-2022 Universit\u00e9 Paris-Saclay\n# Copyright (c) 2020-2022 Universit\u00e9 de Versailles Saint-Quentin-en-Yvelines\n#\n# SPDX-License-Identifier: MIT\n#\n###################################################################################################\n\nfrom dask_interface import Deisa\n# from deisa import Deisa\nfrom dask.distributed import performance_report, wait\nimport os\nimport time\nimport numpy as np\n\nos.environ[\"DASK_DISTRIBUTED__COMM__UCX__INFINIBAND\"] = \"True\"\n\n# Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\n# Initialize Deisa\nDeisa = Deisa(scheduler_info, config_file)\n\n# Get client\nclient = Deisa.get_client()\n\n# either: Get data descriptor as a list of Deisa arrays object\narrays = Deisa.get_deisa_arrays()\n# or: Get data descriptor as a dict of Dask array\n# arrays = Deisa.get_dask_arrays()\n\n# Select data\ngt = arrays[\"global_t\"][...]\nprint(gt, flush=True)\n\n# Check contract\narrays.check_contract()\narrays.validate_contract()\n\nstart = time.time()\n# py-bokeh is needed if you wanna see the perf report\nwith performance_report(filename=\"dask-report.html\"):\n\n    results = []\n    for i in range(25):\n        \n        cpt = np.sum(gt[i])\n\n        s = client.persist(cpt, release=True)\n\n        results.append(client.compute(s))\n\n    del gt\n\n# Write the results\nwith open(\"results.log\", \"a\") as f:\n    result = [cpt.result() for cpt in results]\n    f.write(str(result))\n\nprint(\"{:&lt;21}\".format(\"EST_ANALYTICS_TIME:\") + \"{:.5f}\".format(time.time()-start))\n\n\nprint(\"Done\", flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"below":[{"id":"1012"}],"center":[{"id":"1015"},{"id":"1019"}],"left":[{"id":"1016"}],"renderers":[{"id":"1034"}],"sizing_mode":"stretch_both","title":{"id":"1413"},"toolbar":{"id":"1025"},"x_range":{"id":"1004"},"x_scale":{"id":"1008"},"y_range":{"id":"1006"},"y_scale":{"id":"1010"}},"id":"1003","subtype":"Figure","type":"Plot"},{"attributes":{"coordinates":null,"group":null,"text":"Bandwidth by Worker"},"id":"1153","type":"Title"},{"attributes":{},"id":"1320","type":"UnionRenderers"},{"attributes":{"source":{"id":"1213"}},"id":"1398","type":"CDSView"},{"attributes":{},"id":"1497","type":"UnionRenderers"},{"attributes":{},"id":"1456","type":"AllLabels"},{"attributes":{},"id":"1508","type":"UnionRenderers"},{"attributes":{"axis_label":"Bytes / second","coordinates":null,"formatter":{"id":"1364"},"group":null,"major_label_policy":{"id":"1316"},"ticker":{"id":"1297"}},"id":"1296","type":"LinearAxis"},{"attributes":{"axis":{"id":"1292"},"coordinates":null,"group":null,"ticker":null},"id":"1295","type":"Grid"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"coordinates":null,"formatter":{"id":"1447"},"group":null,"major_label_policy":{"id":"1448"},"ticker":{"id":"1167"}},"id":"1166","type":"CategoricalAxis"},{"attributes":{},"id":"1498","type":"Selection"},{"attributes":{"months":[0,4,8]},"id":"1469","type":"Mo
